import React from 'react';
import ContactList from './ContactsList8'
import './neha.jpg'
function ContactMaster()
{
  return(
    <div>
    <ContactList
    contact={{name:"niharika sharma",imgURL:"./neha.png"}}
    />
    <ContactList
    contact={{name:"MUSKAN sharma",imgURL:"#"}}
    />
    <ContactList
    contact={{name:"PRATHAM sharma",imgURL:"#"}}
    />
    </div>
